import React from "react";

const Home = () => {
  return (
    <div>
      <div className="container-fluid mt-3">
        <div className="row">
          {/* Left Sidebar */}
          <div className="col-md-2" id="main-left-sec">{/* Add left sidebar content here */}</div>


          {/* Main Content (Feed) */}
          <div className="col-md-8" id="main-center-sec">{/* Display posts here */}</div>


          {/* Right Sidebar */}
          <div className="col-md-2" id="main-right-sec">{/* Add right sidebar content here */}</div>
        </div>
      </div>
    </div>
  );
};

export default Home;
